import { Section, FollowerName, ListOfFollower, Follower } from "./styles";

const FollowContainer = (props) => {
    return (
        <Section>
            <ListOfFollower>
                {(props?.follwers).map((flw) => (
                    <Follower
                        onClick={() => window.location.href(flw?.url)}
                        key={flw?.id}
                    >
                        <h2>{flw?.login}</h2>
                        <p>{flw?.url}</p>
                    </Follower>
                ))}
            </ListOfFollower>
        </Section>
    );
};

export default FollowContainer;
